import React, { Component } from 'react';
import { connect } from 'react-redux';

class Home extends Component{

    render(){
        const mapStateToProps = (state) => {
        return {
            items: state.items
        }
}

        return(
            <div className="container">
               <h3>Home</h3>
            </div>
        )
    }

}    

export default connect(mapStateToProps)(Home)
